import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import TodoList from './TodoList';




let h1 = React.createElement('h1', 'ces', 'hello world!!!')

class HelloWorld extends React.Component {
  render() {
    return React.createElement(
      'h1',
      this.props,
      'Hello' + this.props.framework + 'world')
  }
}

ReactDOM.render(
  React.createElement(
    'div',
    null,
    React.createElement(
      'h1',
      this.props,
      React.createElement(
        HelloWorld, {'id':1, 'framework': 'django', 'title': 'for Back-end'}
      ),
      React.createElement(
        HelloWorld, {'id':2, 'framework': 'react', 'title': 'for Front-end'}
      ),
      React.createElement(
        HelloWorld, {'id':3, 'framework': 'flask', 'title': 'for sheet'}
      ),
    )
  )
)


